eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony import */ var vue__WEBPACK_IMPORTED_MODULE_0__ = __webpack_require__(/*! vue */ \"./node_modules/@vue/runtime-dom/dist/runtime-dom.esm-bundler.js\");\n\n\nconst _hoisted_1 = { class: \"content element-doc\" }\nconst _hoisted_2 = /*#__PURE__*/Object(vue__WEBPACK_IMPORTED_MODULE_0__[\"createStaticVNode\"])(\"<h2 id=\\\"zi-ding-yi-zhu-ti\\\"><a class=\\\"header-anchor\\\" href=\\\"#zi-ding-yi-zhu-ti\\\">¶</a> 自定义主题</h2><p>Element 默认提供一套主题，CSS 命名采用 BEM 的风格，方便使用者覆盖样式。我们提供了四种方法，可以进行不同程度的样式自定义。</p><h3 id=\\\"zhu-ti-bian-ji-qi\\\"><a class=\\\"header-anchor\\\" href=\\\"#zhu-ti-bian-ji-qi\\\">¶</a> 主题编辑器</h3><p>使用<a href=\\\"./#/zh-CN/theme\\\">在线主题编辑器</a>，可以修改定制 Element 所有全局和组件的 Design Tokens，并可以方便地实时预览样式改变后的视觉。同时它还可以基于新的定制样式生成完整的样式文件包，供直接下载使用（关于如何使用下载的主题包，请参考本节「引入自定义主题」部分）。</p><p>也可以使用<a href=\\\"https://chrome.google.com/webstore/detail/element-theme-roller/lifkjlojflekabbmlddfccdkphlelmim\\\">主题编辑器 Chrome 插件</a>，在任何使用 Element 开发的网站上配置并实时预览主题。</p><img src=\\\"https://shadow.elemecdn.com/app/sns-client/element-theme-editor2.e16c6a01-806d-11e9-bc23-21435c54c509.png\\\" style=\\\"width:100%;margin:30px auto 0;display:block;\\\"><h3 id=\\\"jin-ti-huan-zhu-ti-se\\\"><a class=\\\"header-anchor\\\" href=\\\"#jin-ti-huan-zhu-ti-se\\\">¶</a> 仅替换主题色</h3><p>如果仅希望更换 Element 的主题色，推荐使用<a href=\\\"https://elementui.github.io/theme-chalk-preview\\\">在线主题生成工具</a>。Element 默认的主题色是鲜艳、友好的蓝色。通过替换主题色，能够让 Element 的视觉更加符合具体项目的定位。</p><p>使用上述工具，可以很方便地实时预览主题色改变之后的视觉，同时它还可以基于新的主题色生成完整的样式文件包，供直接下载使用（关于如何使用下载的主题包，请参考本节「引入自定义主题」和「搭配插件按需引入组件主题」部分）。</p><h3 id=\\\"zai-xiang-mu-zhong-gai-bian-scss-bian-liang\\\"><a class=\\\"header-anchor\\\" href=\\\"#zai-xiang-mu-zhong-gai-bian-scss-bian-liang\\\">¶</a> 在项目中改变 SCSS 变量</h3><p>Element 的 theme-chalk 使用 SCSS 编写，如果你的项目也使用了 SCSS，那么可以直接在项目中改变 Element 的样式变量。新建一个样式文件，例如 <code>element-variables.scss</code>，写入以下内容：</p><pre><code class=\\\"language-html\\\">/* 改变主题色变量 */\\n$--color-primary: teal;\\n\\n/* 改变 icon 字体路径变量，必需 */\\n$--font-path: &#39;~element-ui/lib/theme-chalk/fonts&#39;;\\n\\n@import &quot;~element-ui/packages/theme-chalk/src/index&quot;;\\n</code></pre><p>之后，在项目的入口文件中，直接引入以上样式文件即可（无需引入 Element 编译好的 CSS 文件）：</p><pre><code class=\\\"language-JS\\\">import Vue from &#39;vue&#39;\\nimport Element from &#39;element-ui&#39;\\nimport &#39;./element-variables.scss&#39;\\n\\nVue.use(Element)\\n</code></pre><div class=\\\"tip\\\"><p>需要注意的是，覆盖字体路径变量是必需的，将其赋值为 Element 中 icon 图标所在的相对路径即可。</p></div><h3 id=\\\"ming-ling-xing-zhu-ti-gong-ju\\\"><a class=\\\"header-anchor\\\" href=\\\"#ming-ling-xing-zhu-ti-gong-ju\\\">¶</a> 命令行主题工具</h3><p>如果你的项目没有使用 SCSS，那么可以使用命令行主题工具进行深层次的主题定制：</p><h4 id=\\\"an-zhuang-gong-ju\\\"><a class=\\\"header-anchor\\\" href=\\\"#an-zhuang-gong-ju\\\">¶</a> <strong>安装工具</strong></h4><p>首先安装「主题生成工具」，可以全局安装或者安装在当前项目下，推荐安装在项目里，方便别人 clone 项目时能直接安装依赖并启动，这里以全局安装做演示。</p><pre><code class=\\\"language-shell\\\">npm i element-theme -g\\n</code></pre><p>安装白垩主题，可以从 npm 安装或者从 GitHub 拉取最新代码。</p><pre><code class=\\\"language-shell\\\"># 从 npm\\nnpm i element-theme-chalk -D\\n\\n# 从 GitHub\\nnpm i https://github.com/ElementUI/theme-chalk -D\\n</code></pre><h4 id=\\\"chu-shi-hua-bian-liang-wen-jian\\\"><a class=\\\"header-anchor\\\" href=\\\"#chu-shi-hua-bian-liang-wen-jian\\\">¶</a> <strong>初始化变量文件</strong></h4><p>主题生成工具安装成功后，如果全局安装可以在命令行里通过 <code>et</code> 调用工具，如果安装在当前目录下，需要通过 <code>node_modules/.bin/et</code> 访问到命令。执行 <code>-i</code> 初始化变量文件。默认输出到 <code>element-variables.scss</code>，当然你可以传参数指定文件输出目录。</p><pre><code class=\\\"language-shell\\\">et -i [可以自定义变量文件]\\n\\n&gt; ✔ Generator variables file\\n</code></pre><p>如果使用默认配置，执行后当前目录会有一个 <code>element-variables.scss</code> 文件。内部包含了主题所用到的所有变量，它们使用 SCSS 的格式定义。大致结构如下：</p><pre><code class=\\\"language-css\\\">$--color-primary: #409EFF !default;\\n$--color-primary-light-1: mix($--color-white, $--color-primary, 10%) !default; /* 53a8ff */\\n$--color-primary-light-2: mix($--color-white, $--color-primary, 20%) !default; /* 66b1ff */\\n$--color-primary-light-3: mix($--color-white, $--color-primary, 30%) !default; /* 79bbff */\\n$--color-primary-light-4: mix($--color-white, $--color-primary, 40%) !default; /* 8cc5ff */\\n$--color-primary-light-5: mix($--color-white, $--color-primary, 50%) !default; /* a0cfff */\\n$--color-primary-light-6: mix($--color-white, $--color-primary, 60%) !default; /* b3d8ff */\\n$--color-primary-light-7: mix($--color-white, $--color-primary, 70%) !default; /* c6e2ff */\\n$--color-primary-light-8: mix($--color-white, $--color-primary, 80%) !default; /* d9ecff */\\n$--color-primary-light-9: mix($--color-white, $--color-primary, 90%) !default; /* ecf5ff */\\n\\n$--color-success: #67c23a !default;\\n$--color-warning: #e6a23c !default;\\n$--color-danger: #f56c6c !default;\\n$--color-info: #909399 !default;\\n\\n...\\n</code></pre><h4 id=\\\"xiu-gai-bian-liang\\\"><a class=\\\"header-anchor\\\" href=\\\"#xiu-gai-bian-liang\\\">¶</a> <strong>修改变量</strong></h4><p>直接编辑 <code>element-variables.scss</code> 文件，例如修改主题色为红色。</p><pre><code class=\\\"language-CSS\\\">$--color-primary: red;\\n</code></pre><h4 id=\\\"bian-yi-zhu-ti\\\"><a class=\\\"header-anchor\\\" href=\\\"#bian-yi-zhu-ti\\\">¶</a> <strong>编译主题</strong></h4><p>保存文件后，到命令行里执行 <code>et</code> 编译主题，如果你想启用 <code>watch</code> 模式，实时编译主题，增加 <code>-w</code> 参数；如果你在初始化时指定了自定义变量文件，则需要增加 <code>-c</code> 参数，并带上你的变量文件名。默认情况下编译的主题目录是放在 <code>./theme</code> 下，你可以通过 <code>-o</code> 参数指定打包目录。</p><pre><code class=\\\"language-shell\\\">et\\n\\n&gt; ✔ build theme font\\n&gt; ✔ build element theme\\n</code></pre><h3 id=\\\"shi-yong-zi-ding-yi-zhu-ti\\\"><a class=\\\"header-anchor\\\" href=\\\"#shi-yong-zi-ding-yi-zhu-ti\\\">¶</a> 使用自定义主题</h3><h4 id=\\\"yin-ru-zi-ding-yi-zhu-ti\\\"><a class=\\\"header-anchor\\\" href=\\\"#yin-ru-zi-ding-yi-zhu-ti\\\">¶</a> <strong>引入自定义主题</strong></h4><p>和引入默认主题一样，在代码里直接引用「在线主题编辑器」或「命令行工具」生成的主题的 <code>theme/index.css</code> 文件即可。</p><pre><code class=\\\"language-javascript\\\">import &#39;../theme/index.css&#39;\\nimport ElementUI from &#39;element-ui&#39;\\nimport Vue from &#39;vue&#39;\\n\\nVue.use(ElementUI)\\n</code></pre><h4 id=\\\"da-pei-cha-jian-an-xu-yin-ru-zu-jian-zhu-ti\\\"><a class=\\\"header-anchor\\\" href=\\\"#da-pei-cha-jian-an-xu-yin-ru-zu-jian-zhu-ti\\\">¶</a> <strong>搭配插件按需引入组件主题</strong></h4><p>如果是搭配 <code>babel-plugin-component</code> 一起使用，只需要修改 <code>.babelrc</code> 的配置，指定 <code>styleLibraryName</code> 路径为自定义主题相对于 <code>.babelrc</code> 的路径，注意要加 <code>~</code>。</p><pre><code class=\\\"language-json\\\">{\\n  &quot;plugins&quot;: [\\n    [\\n      &quot;component&quot;,\\n      {\\n        &quot;libraryName&quot;: &quot;element-ui&quot;,\\n        &quot;styleLibraryName&quot;: &quot;~theme&quot;\\n      }\\n    ]\\n  ]\\n}\\n</code></pre><p>如果不清楚 <code>babel-plugin-component</code> 是什么，请阅读 <a href=\\\"./#/zh-CN/component/quickstart\\\">快速上手</a> 一节。更多 <code>element-theme</code> 用法请参考<a href=\\\"https://github.com/ElementUI/element-theme\\\">项目仓库</a>。</p>\", 41)\n\nfunction render(_ctx, _cache) {\n  return (Object(vue__WEBPACK_IMPORTED_MODULE_0__[\"openBlock\"])(), Object(vue__WEBPACK_IMPORTED_MODULE_0__[\"createBlock\"])(\"section\", _hoisted_1, [\n    _hoisted_2\n  ]))\n}//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./node_modules/vue-loader/dist/templateLoader.js?!./node_modules/vue-loader/dist/index.js?!./website/md-loader/index.js!./website/docs/zh-CN/custom-theme.md?vue&type=template&id=a8e6e4ae\n");

